import React, {useState} from 'react';

import { booking } from '../../../settings';
import { StyledBookingInput, StyledBookingForm } from '../BookingEndpoint/Booking.styles';
import { MyBody } from '../BookingEndpoint/Booking.styles';

const BookingEndpoint = () => {    
const requestOptions = {
    method: 'POST',
    headers: { 'Content-Type': 'application/json'}
    };
fetch(booking, requestOptions)
.then(response => response.json())
.then(data => setState({postId: data.id}))
    

return (
    <MyBody>
        <StyledBookingForm method="post">
            <StyledBookingInput
            placeholder="day/month/year"
            id="bookingDate">
            </StyledBookingInput>
            
            <StyledBookingInput
                placeholder="duration in minutes"
                id="duration"
            ></StyledBookingInput>

        </StyledBookingForm>
    </MyBody>

    );
}
export default BookingEndpoint;
